import React from "react"

const Users = () => {
    const users = [
        {
            id: 1,
            firstname: 'Bob',
            lastname: 'Marley',
            bio: 'fdsfsadf',
            age: 40,
            isHappy: true,
        },
        {
            id: 2,
            firstname: 'Bob',
            lastname: 'Marley',
            bio: 'fdsfsadf',
            age: 40,
            isHappy: false,
        },
         {
            id: 3,
            firstname: 'Bob',
            lastname: 'Marley',
            bio: 'fdsfsadf',
            age: 40,
            isHappy: true,
        }
    ]
    if (users.length > 0)
    return (
        <div>
            {users.map((user) => (<div key={user.id}>
                <h3>{user.firstname} {user.lastname}</h3>
                <p>{user.bio}</p>
                <p>{user.age}</p>
                <p>{user.isHappy == true}</p>
            </div>))}
        </div>
    )  

    else return (
        <div>
            ПУСТО
        </div>
    )  
  }
  
export default Users
